window.bookSummaryJSON = "<p><b>Uncountable bugs. Endless, enormous power. Break out the quack tape.</b></p> <p>Round one of the Eternia Beta run ends with the Task Manager getting disabled by the Administrator. Without the Task Manager’s nefarious influences, Eternia comes to life as warm hugs and sweet sunshine beat back The Pale.</p> <p>With these issues properly sorted, the Eternia Beta can begin, and the Heavenlies can come out to play! Even if Avalon’s new additions are someone else’s problem, Artorian the Administrator remains locked in a seemingly never-ending battle against a bug-infested game system.</p> <p>Abilities always work as described. The floor is always real. That cat was always there.</p>"; 
